import React from 'react';
import logo from './logo.svg';
import './App.css';
import Menu from './Components/Menu';
import { Route, Routes } from 'react-router-dom';
import Login from './Components/Login'

function App() {
  return (
    <div>
      <Routes>
          <Menu />
          <Route path="/login" element={<Login />} />
      </Routes>
    </div>
  );
}

export default App;
